INSERT INTO `wp_posts` VALUES (25,1,'2021-05-18 13:17:51','2021-05-18 03:17:51','<!-- wp:media-text {\"mediaId\":15,\"mediaLink\":\"https://hannahgrace.local/face/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/face-1024x1024.jpg\" alt=\"\" class=\"wp-image-15 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/signature-facial/\">Facials</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"style\":{\"color\":{\"text\":\"#6b3b3c\"}},\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size\" style=\"color:#6b3b3c\">All our relaxing facials use Pure Fiji Professional products, with amazing tropical scents and gorgeous textures youll absolutely love. Each facial is specifically created to target your skin concerns and includes a free skin consult with every facial, after skin consult the facial can be tailored personally to you and your skin! Using techniques of massage with our products to help reduce puffiness, dry, oily and problem areas and increase circulation for glowing skin.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":13,\"mediaLink\":\"https://hannahgrace.local/massage/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/massage-1024x1024.jpg\" alt=\"\" class=\"wp-image-13 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/massage-2/\">Massages</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"style\":{\"color\":{\"text\":\"#683737\"}},\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size\" style=\"color:#683737\">Using exotic oil from Pure Fiji our massages not only relax you but also have amazing skin benefits. Along with the amazing scent of the oil our massages will leave you feeling relaxed and your skin feeling renewed.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":17,\"mediaLink\":\"https://hannahgrace.local/legs/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/legs-1024x1024.jpg\" alt=\"\" class=\"wp-image-17 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/packages/\">Packages</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"style\":{\"color\":{\"text\":\"#6b4242\"}},\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size\" style=\"color:#6b4242\">Each of our packages includes a full body body wrap and a mini facial. These packages are for you to indulge in the ultimate relaxation in the comfort of your own home while also achieving amazing skin benefits with professional products and equipment.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":16,\"mediaLink\":\"https://hannahgrace.local/feet/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/feet-1024x1024.jpg\" alt=\"\" class=\"wp-image-16 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/pedicure/\">Pedicures</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"style\":{\"color\":{\"text\":\"#5f3738\"}},\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size\" style=\"color:#5f3738\">Our pedicures are perfect for helping rejuvenate and replenish your feet to the softest they can be. Using a foot scrub and blend of mask or lotion we strive to keep your feet looking their best, and with polish to top it off you know your feet are getting the treatment they need and for you to feel your best confident self.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->','Home','','publish','closed','closed','','home','','','2021-05-31 11:10:11','2021-05-31 01:10:11','',0,'https://hannahgrace.local/?page_id=25',0,'page','',0);
