INSERT INTO `wp_posts` VALUES (126,2,'2021-05-31 10:17:52','2021-05-31 00:17:52','<h2 style=\"text-align: left;\"><strong>Signature Facial</strong></h2>\r\n<p class=\"p1\">A beautiful blend of relaxation and rejuvenation of your skin. Starting with a refreshing double cleanse to clean and nourish your skin, followed by a facial massage to completely relax you. An exfoliating mask is then applied while you enjoy a scalp neck and shoulder massage. A customised routine of active serums and moisturiser is then applied to specially suit and enhance your individual skin. Perfect for skin that needs a pick me up or those looking for a relaxing facial.<span class=\"Apple-converted-space\"></span></p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 1 hour)</h6>\r\n<h2 class=\"p1\"><b>Pure hydration<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">As the name suggests this facial is perfect for skin that needs a bit of hydration and TLC. Starting with a smooth cream cleanser to clean and hydrate the skin, followed by a gentle exfoliate. A hydrating gel mask is then applied and while it sets you enjoy a relaxing hand and foot massage. Finishing with specified products for your skin and a facial massage.<span class=\"Apple-converted-space\"></span></p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 1 hour 30min)</h6>\r\n<h2 class=\"p1\"><b>Skin rewind<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">This beautiful facial is for anyone looking for some rejuvenation and anti ageing. From the cleanser down to the finishing products in this treatment everything is created to target signs of ageing such as fine lines, hyper pigmentation and everything in-between. Starting with a cleanser and exfoliating mask with a hand and foot massage. High frequency to infuse products and reduce fine lines, puffiness and penetrating product deeper. Finishing with a beautiful sequence of serums and a facial massage for lymphatic drainage.<span class=\"Apple-converted-space\"></span></p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 1 hour 30min)</h6>','Facials','','publish','closed','closed','','signature-facial','','','2021-05-31 10:31:17','2021-05-31 00:31:17','',0,'https://hannahgrace.local/?page_id=126',0,'page','',0);
INSERT INTO `wp_posts` VALUES (127,2,'2021-05-31 10:17:52','2021-05-31 00:17:52','<p class=\"p1\">A beautiful blend of relaxation and rejuvenation of your skin. Starting with a refreshing double cleanse to clean and nourish your skin, followed by a facial massage to completely relax you. An exfoliating mask is then applied while you enjoy a scalp neck and shoulder massage. A customised routine of active serums and moisturiser is then applied to specially suit and enhance your individual skin. Perfect for skin that needs a pick me up or those looking for a relaxing facial.<span class=\"Apple-converted-space\"></span></p>','Signature facial','','inherit','closed','closed','','126-revision-v1','','','2021-05-31 10:17:52','2021-05-31 00:17:52','',126,'https://hannahgrace.local/?p=127',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (128,2,'2021-05-31 10:19:03','2021-05-31 00:19:03','<!-- wp:media-text {\"mediaId\":15,\"mediaLink\":\"https://hannahgrace.local/face/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/face-1024x1024.jpg\" alt=\"\" class=\"wp-image-15 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Facials</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">All our relaxing facials use Pure Fiji Professional products, with amazing tropical scents and gorgeous textures youll absolutely love. Each facial is specifically created to target your skin concerns and includes a free skin consult with every facial, after skin consult the facial can be tailored personally to you and your skin! Using techniques of massage with our products to help reduce puffiness, dry, oily and problem areas and increase circulation for glowing skin.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":13,\"mediaLink\":\"https://hannahgrace.local/massage/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/massage-1024x1024.jpg\" alt=\"\" class=\"wp-image-13 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Massages</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Using exotic oil from Pure Fiji our massages not only relax you but also have amazing skin benefits. Along with the amazing scent of the oil our massages will leave you feeling relaxed and your skin feeling renewed.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":17,\"mediaLink\":\"https://hannahgrace.local/legs/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/legs-1024x1024.jpg\" alt=\"\" class=\"wp-image-17 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Packages</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Each of our packages includes a full body body wrap and a mini facial. These packages are for you to indulge in the ultimate relaxation in the comfort of your own home while also achieving amazing skin benefits with professional products and equipment.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":16,\"mediaLink\":\"https://hannahgrace.local/feet/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/feet-1024x1024.jpg\" alt=\"\" class=\"wp-image-16 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Pedicures</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Our pedicures are perfect for helping rejuvenate and replenish your feet to the softest they can be. Using a foot scrub and blend of mask or lotion we strive to keep your feet looking their best, and with polish to top it off you know your feet are getting the treatment they need and for you to feel your best confident self.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->','Home','','inherit','closed','closed','','25-revision-v1','','','2021-05-31 10:19:03','2021-05-31 00:19:03','',25,'https://hannahgrace.local/?p=128',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (129,2,'2021-05-31 10:20:39','2021-05-31 00:20:39','<!-- wp:media-text {\"mediaId\":15,\"mediaLink\":\"https://hannahgrace.local/face/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/face-1024x1024.jpg\" alt=\"\" class=\"wp-image-15 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/signature-facial/\">Facials</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">All our relaxing facials use Pure Fiji Professional products, with amazing tropical scents and gorgeous textures youll absolutely love. Each facial is specifically created to target your skin concerns and includes a free skin consult with every facial, after skin consult the facial can be tailored personally to you and your skin! Using techniques of massage with our products to help reduce puffiness, dry, oily and problem areas and increase circulation for glowing skin.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":13,\"mediaLink\":\"https://hannahgrace.local/massage/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/massage-1024x1024.jpg\" alt=\"\" class=\"wp-image-13 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Massages</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Using exotic oil from Pure Fiji our massages not only relax you but also have amazing skin benefits. Along with the amazing scent of the oil our massages will leave you feeling relaxed and your skin feeling renewed.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":17,\"mediaLink\":\"https://hannahgrace.local/legs/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/legs-1024x1024.jpg\" alt=\"\" class=\"wp-image-17 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Packages</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Each of our packages includes a full body body wrap and a mini facial. These packages are for you to indulge in the ultimate relaxation in the comfort of your own home while also achieving amazing skin benefits with professional products and equipment.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":16,\"mediaLink\":\"https://hannahgrace.local/feet/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/feet-1024x1024.jpg\" alt=\"\" class=\"wp-image-16 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>Pedicures</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Our pedicures are perfect for helping rejuvenate and replenish your feet to the softest they can be. Using a foot scrub and blend of mask or lotion we strive to keep your feet looking their best, and with polish to top it off you know your feet are getting the treatment they need and for you to feel your best confident self.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->','Home','','inherit','closed','closed','','25-revision-v1','','','2021-05-31 10:20:39','2021-05-31 00:20:39','',25,'https://hannahgrace.local/?p=129',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (130,2,'2021-05-31 10:21:31','2021-05-31 00:21:31','<h2><strong>Signature Facial</strong></h2>\r\n<p class=\"p1\">A beautiful blend of relaxation and rejuvenation of your skin. Starting with a refreshing double cleanse to clean and nourish your skin, followed by a facial massage to completely relax you. An exfoliating mask is then applied while you enjoy a scalp neck and shoulder massage. A customised routine of active serums and moisturiser is then applied to specially suit and enhance your individual skin. Perfect for skin that needs a pick me up or those looking for a relaxing facial.<span class=\"Apple-converted-space\"></span></p>','Signature facial','','inherit','closed','closed','','126-revision-v1','','','2021-05-31 10:21:31','2021-05-31 00:21:31','',126,'https://hannahgrace.local/?p=130',0,'revision','',0);
