INSERT INTO `wp_posts` VALUES (132,2,'2021-05-31 10:22:25','2021-05-31 00:22:25','<h2><strong>Signature Facial</strong></h2>\r\n&nbsp;\r\n<p class=\"p1\">A beautiful blend of relaxation and rejuvenation of your skin. Starting with a refreshing double cleanse to clean and nourish your skin, followed by a facial massage to completely relax you. An exfoliating mask is then applied while you enjoy a scalp neck and shoulder massage. A customised routine of active serums and moisturiser is then applied to specially suit and enhance your individual skin. Perfect for skin that needs a pick me up or those looking for a relaxing facial.<span class=\"Apple-converted-space\"></span></p>\r\n&nbsp;\r\n<h2 class=\"p1\"><b>Pure hydration<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">As the name suggests this facial is perfect for skin that needs a bit of hydration and TLC. Starting with a smooth cream cleanser to clean and hydrate the skin, followed by a gentle exfoliate. A hydrating gel mask is then applied and while it sets you enjoy a relaxing hand and foot massage. Finishing with specified products for your skin and a facial massage.<span class=\"Apple-converted-space\"></span></p>\r\n&nbsp;\r\n<h2 class=\"p1\"><b>Skin rewind<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">This beautiful facial is for anyone looking for some rejuvenation and anti ageing. From the cleanser down to the finishing products in this treatment everything is created to target signs of ageing such as fine lines, hyper pigmentation and everything in-between. Starting with a cleanser and exfoliating mask with a hand and foot massage. High frequency to infuse products and reduce fine lines, puffiness and penetrating product deeper. Finishing with a beautiful sequence of serums and a facial massage for lymphatic drainage.<span class=\"Apple-converted-space\"></span></p>','Signature facial','','inherit','closed','closed','','126-revision-v1','','','2021-05-31 10:22:25','2021-05-31 00:22:25','',126,'https://hannahgrace.local/?p=132',0,'revision','',0);
