INSERT INTO `wp_posts` VALUES (142,2,'2021-05-31 10:40:34','2021-05-31 00:40:34','<h2 class=\"p1\"><b>Mini full body pamper</b></h2>\r\n<p class=\"p2\">This pamper back include a body wrap and mini facial. Perfect treatment on a time schedule to still cover all bases. Dry body brush for exfoliating and stimulation of blood flow for healthier glowing skin, a mask is then applied over the whole body and wrapped in a warm sheet to soak up the hydrating mask. Our mini facial includes a foaming cleanse, facial scrub, mini mask and a mixture of high frequency and draining rose quartz massage to reduce puffiness of the face and sooth. Ending in a mini body massage to absorb all the mask.<span class=\"Apple-converted-space\"></span></p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 1 hour 30min)</h6>\r\n<h2 class=\"p1\"><b>Ultimate full body pamper<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">This body pamper package is the ultimate combination of our facial and body wrap. Starting with a foot scrub and mask, full body dry brush to increase blood flow and keep your skin glowing and body scrub to further polish the skin. Followed by a beautiful hydrating body mask and wrapped in warm sheets to let your skin soak the mask. Our mini facial includes a cleanser, facial scrub, mini mask and a mixture of high frequency and draining rose quartz massage to reduce puffiness in the face and sooth. Finishing with a body massage to further infuse the mask.</p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 2 hours 30min)</h6>\r\n<h2 class=\"p1\"><b>Luxury Full body wrap</b></h2>\r\n<p class=\"p2\">This beautiful treatment focusses the most on the whole body. Dry body brush to gently exfoliate and warm up your skin for a cleansing scrub thats then massaged over the whole body to nourish and smells divine. A body mask is then applied to give your skin a smooth polish and really boost hydration leaving your skin feeling supple. While our mask soaks into your skin you enjoy a head and facial massage using high frequency and cleansing facial oil. Finishing with a relaxing warm towel to remove any excess mask and a light massage over the body using our final step exotic hydrating massage oil.<span class=\"Apple-converted-space\"></span></p>\r\n\r\n<h6 style=\"text-align: right;\">(approx. 2 hours)</h6>','Packages','','publish','closed','closed','','packages','','','2021-05-31 10:42:12','2021-05-31 00:42:12','',0,'https://hannahgrace.local/?page_id=142',0,'page','',0);
