INSERT INTO `wp_posts` VALUES (149,2,'2021-05-31 10:46:26','2021-05-31 00:46:26','<h2 class=\"p1\"><b>Mini Pedicure<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">Beginning with a relaxing foot soak followed by a foot scrub to smooth your skin and buff to remove any hard areas and soaking again to remove the scrub. Cut, file and buff and a foot massage with your choice of polish, gel polish (+$5) or no polish.<span class=\"Apple-converted-space\"></span></p>\r\n&nbsp;\r\n<h2 class=\"p1\"><b>Deluxe Pedicure</b></h2>\r\n<p class=\"p2\">Our deluxe pedicure begins with a relaxing foot soak followed by a scrub to smooth your feet. Then buffing the feet to remove any hard areas and soaking again. A mask is then applied to the feet for 20 minutes then cut, file and foot massage with gorgeous lotion and your choice of polish, gel polish ($5) or no polish.<span class=\"Apple-converted-space\"></span></p>','Pedicure','','publish','closed','closed','','pedicure','','','2021-05-31 10:46:26','2021-05-31 00:46:26','',0,'https://hannahgrace.local/?page_id=149',0,'page','',0);
INSERT INTO `wp_posts` VALUES (150,2,'2021-05-31 10:46:26','2021-05-31 00:46:26','<h2 class=\"p1\"><b>Mini Pedicure<span class=\"Apple-converted-space\"></span></b></h2>\r\n<p class=\"p2\">Beginning with a relaxing foot soak followed by a foot scrub to smooth your skin and buff to remove any hard areas and soaking again to remove the scrub. Cut, file and buff and a foot massage with your choice of polish, gel polish (+$5) or no polish.<span class=\"Apple-converted-space\"></span></p>\r\n&nbsp;\r\n<h2 class=\"p1\"><b>Deluxe Pedicure</b></h2>\r\n<p class=\"p2\">Our deluxe pedicure begins with a relaxing foot soak followed by a scrub to smooth your feet. Then buffing the feet to remove any hard areas and soaking again. A mask is then applied to the feet for 20 minutes then cut, file and foot massage with gorgeous lotion and your choice of polish, gel polish ($5) or no polish.<span class=\"Apple-converted-space\"></span></p>','Pedicure','','inherit','closed','closed','','149-revision-v1','','','2021-05-31 10:46:26','2021-05-31 00:46:26','',149,'https://hannahgrace.local/?p=150',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (151,2,'2021-05-31 10:46:58','2021-05-31 00:46:58','<!-- wp:media-text {\"mediaId\":15,\"mediaLink\":\"https://hannahgrace.local/face/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/face-1024x1024.jpg\" alt=\"\" class=\"wp-image-15 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/signature-facial/\">Facials</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">All our relaxing facials use Pure Fiji Professional products, with amazing tropical scents and gorgeous textures youll absolutely love. Each facial is specifically created to target your skin concerns and includes a free skin consult with every facial, after skin consult the facial can be tailored personally to you and your skin! Using techniques of massage with our products to help reduce puffiness, dry, oily and problem areas and increase circulation for glowing skin.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":13,\"mediaLink\":\"https://hannahgrace.local/massage/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/massage-1024x1024.jpg\" alt=\"\" class=\"wp-image-13 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/massage-2/\">Massages</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Using exotic oil from Pure Fiji our massages not only relax you but also have amazing skin benefits. Along with the amazing scent of the oil our massages will leave you feeling relaxed and your skin feeling renewed.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":17,\"mediaLink\":\"https://hannahgrace.local/legs/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/legs-1024x1024.jpg\" alt=\"\" class=\"wp-image-17 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/packages/\">Packages</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Each of our packages includes a full body body wrap and a mini facial. These packages are for you to indulge in the ultimate relaxation in the comfort of your own home while also achieving amazing skin benefits with professional products and equipment.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":16,\"mediaLink\":\"https://hannahgrace.local/feet/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://hannahgrace.local/wp-content/uploads/2021/05/feet-1024x1024.jpg\" alt=\"\" class=\"wp-image-16 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2><a href=\"https://hannahgrace.local/pedicure/\">Pedicures</a></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content\",\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">Our pedicures are perfect for helping rejuvenate and replenish your feet to the softest they can be. Using a foot scrub and blend of mask or lotion we strive to keep your feet looking their best, and with polish to top it off you know your feet are getting the treatment they need and for you to feel your best confident self.&nbsp;</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->','Home','','inherit','closed','closed','','25-revision-v1','','','2021-05-31 10:46:58','2021-05-31 00:46:58','',25,'https://hannahgrace.local/?p=151',0,'revision','',0);
