INSERT INTO `wp_posts` VALUES (176,2,'2021-06-01 08:12:35','2021-05-31 22:12:35','<h2 class=\"p1\" style=\"text-align: center;\">Welcome!</h2>\r\n&nbsp;\r\n<p class=\"p1\" style=\"text-align: center;\">My name is Hannah, Im a qualified beauty therapist and mummy to a beautiful 18 month old girl. Being a mum I know how hard it is to find time for yourself and relax and feel comfortable. Hannah Grace Beauty is a mobile beauty service dedicated to creating amazing skin and bringing professional skin care and services to you in the comfort of your own home! <span class=\"Apple-converted-space\"></span></p>\r\n<p class=\"p1\" style=\"text-align: center;\">A bit about myself, I studied a diploma of beauty therapy in 2015 and fell in love instantly. Ive been working in the industry ever since gaining knowledge and experience in every possible way. Skin care is my passion and I am so excited to bring that to amazing people and bring people a new level of comfort and relaxation that cant always be achieved in a salon setting, while still using professional products and equipment to bring the same level of quality as in a salon.<span class=\"Apple-converted-space\"></span></p>\r\n<p class=\"p1\" style=\"text-align: center;\">We use a brand called Pure Fiji, I fell in love with this brand because of many reasons, first was the exquisite aroma of each and every product. These tropical scents are not the only things that caught my attention, I have used Pure Fiji on myself and past clients and they are some of the most gentle yet effective products I have used to date and clients have always commented on how amazing they feel, smell and the amazing results they give.<span class=\"Apple-converted-space\"></span></p>\r\n<p class=\"p1\" style=\"text-align: center;\">The business is based in Narangba, QLD and services North Brisbane up to the Sunshine Coast. If you are unsure whether we service your area please feel free to get in contact using the Contact Us page and we will get back to you as soon as possible. Being mobile we have a 25km radius that is free of charge, if you are outside the radius a small surcharge will be added to cover travel.<span class=\"Apple-converted-space\"></span></p>','About','','publish','closed','closed','','about','','','2021-06-01 08:29:56','2021-05-31 22:29:56','',0,'https://hannahgrace.local/?page_id=176',0,'page','',0);
