INSERT INTO `wp_posts` VALUES (183,2,'2021-06-01 08:30:31','2021-05-31 22:30:31','<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"color\":{\"text\":\"#774142\"}},\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-text-color has-large-font-size\" style=\"color:#774142\"><strong>Get in Touch!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"color\":{\"text\":\"#7c4243\"}},\"fontSize\":\"normal\"} -->\n<p class=\"has-text-align-center has-text-color has-normal-font-size\" style=\"color:#7c4243\">We love hearing from you! If you have any questions, comments or would like to arrange a booking, please reach out using the form below and we will be in-touch shortly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"style\":{\"color\":{\"text\":\"#6b3838\"}},\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-left has-text-color has-large-font-size\" style=\"color:#6b3838\"><strong>Opening Hours&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6b3b3c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6b3b3c\">Monday 9:00am - 5:30am&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#683435\"}}} -->\n<p class=\"has-text-color\" style=\"color:#683435\">Tuesday CLOSED</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#6d3637\"}}} -->\n<p class=\"has-text-color\" style=\"color:#6d3637\">Wednesday CLOSED&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#754041\"}}} -->\n<p class=\"has-text-color\" style=\"color:#754041\">Thursday 9:00am - 7:00pm&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#723839\"}}} -->\n<p class=\"has-text-color\" style=\"color:#723839\">Friday 9:00am - 5:30pm&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#693334\"}}} -->\n<p class=\"has-text-color\" style=\"color:#693334\">Saturday 8:00am - 4:00pm</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5d2d2e\"}}} -->\n<p class=\"has-text-color\" style=\"color:#5d2d2e\">Sunday CLOSED</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n[contact-form-7 id=\"5\" title=\"Contact form 1\"]\n<!-- /wp:shortcode -->','Contact Us','','inherit','closed','closed','','69-revision-v1','','','2021-06-01 08:30:31','2021-05-31 22:30:31','',69,'https://hannahgrace.local/?p=183',0,'revision','',0);
