oubleshooting\\/\",\"order\":3}],\"order\":4},{\"title\":\"Tools\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/\",\"excerpt\":\"Wordfence Tools include Two Factor Authentication, Whois Lookup, Password Audit, Live Traffic and Diagnostics.\",\"children\":[{\"title\":\"Import\\/Export\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/import-export\\/\",\"order\":0},{\"title\":\"Password Auditing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/password-auditing\\/\",\"order\":1},{\"title\":\"Whois Lookup\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/whois-lookup\\/\",\"order\":2},{\"title\":\"Diagnostics\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/diagnostics\\/\",\"order\":3},{\"title\":\"Live Traffic\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/live-traffic\\/\",\"order\":4},{\"title\":\"Two-Factor Authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/two-factor-authentication\\/\",\"order\":5},{\"title\":\"Legacy Two-Factor Authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/legacy-two-factor-authentication\\/\",\"order\":6}],\"order\":5},{\"title\":\"Login Security\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/login-security\\/\",\"excerpt\":\"The Login Security page currently contains settings for two-factor authentication (2FA) and reCAPTCHA. In a future Wordfence version, existing login-related features will also move to the same page.\",\"order\":6},{\"title\":\"Advanced\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/\",\"excerpt\":\"If you want to know more about the technical details of Wordfence, you\'ll find the answers in this section.\",\"children\":[{\"title\":\"System requirements\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/system-requirements\\/\",\"order\":0},{\"title\":\"Changelog\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/changelog\\/\",\"order\":1},{\"title\":\"Remove or Reset\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/remove-or-reset\\/\",\"order\":2},{\"title\":\"Technical Details\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/technical-details\\/\",\"order\":3},{\"title\":\"Constants\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/constants\\/\",\"order\":4},{\"title\":\"Wordfence API\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/wordfence-api\\/\",\"order\":5},{\"title\":\"Troubleshooting\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/troubleshooting\\/\",\"order\":6}],\"order\":7},{\"title\":\"Wordfence Premium\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/premium\\/\",\"excerpt\":\"Wordfence Premium comes with an IP Blocklist, Real Time Protection and much more.\",\"children\":[{\"title\":\"Account\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/premium\\/account\\/\",\"order\":0},{\"title\":\"Pricing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/premium\\/pricing\\/\",\"order\":1},{\"title\":\"License Key\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/premium\\/api-key\\/\",\"order\":2}],\"order\":8},{\"title\":\"Wordfence and GDPR - General Data Protection Regulation\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/general-data-protection-regulation\\/\",\"excerpt\":\"Defiant, the company behind Wordfence, has updated its terms of use, privacy policies and software, as well as made available a data processing agreement to meet GDPR compliance. Customers must review and agree to updated terms in order to continue using our products and services. We also provide a data processing agreement if you qualify as a data controller under the GDPR.\",\"children\":[{\"title\":\"Sub-Processors List\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/general-data-protection-regulation\\/sub-processors-list\\/\",\"order\":0}],\"order\":9},{\"title\":\"Site Cleaning and Security Audits\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/security-services\\/\",\"excerpt\":\"Let one of our Security Analysts help you clean your infected site or inspect it for vulnerabilities.\",\"order\":10},{\"title\":\"Login Security Plugin\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/login-security-plugin\\/\",\"excerpt\":\"The Wordfence Login Security plugin contains a subset of the features found in the full Wordfence plugin: Two-factor Authentication, XML-RPC Protection and Login Page CAPTCHA. It is ideal for sites that need login security functionality but either can\\u2019t or don\\u2019t want to run the full Wordfence plugin.\",\"order\":11}]}','yes');
